import React from "react";

import {NavLink} from 'react-router-dom';
import './BurgerMenu.css';

const burgerMenu = props => (
    <nav>
        <ul className="side-menu">
          <li><NavLink className="side-menu__link" exact to="/" >Home</NavLink></li>
          <li><NavLink className="side-menu__link" exact to="/about" >About</NavLink></li>
          <li><NavLink className="side-menu__link" exact to="/destination" >Where to go?</NavLink></li>
          <li><NavLink className="nav-menu__link" exact to="/contact" >Contact</NavLink></li>
        </ul>
    </nav>

);

export default burgerMenu;
